import { FC } from "react";
import styles from "./index.module.scss";

type Props = {
  data: {
    title: string;
    icon: string;
    points: string[];
  };
};
export const DetailedList: FC<Props> = ({ data }) => {
  return (
    <div className={styles.list}>
      <span className="material-symbols-outlined">{data.icon}</span>;
    </div>
  );
};
